import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; // Importation du Router et des Routes

import Header from './components/Header';
import Footer from './components/Footer';
import MainContent from './components/MainContent';
import Interface1 from './components/Interface1';
import Interface2 from './components/Interface2';
import Interface3 from './components/Interface3';
import Interface4 from './components/Interface4';

function App() {
  const [currentPage, setCurrentPage] = useState('Home');

  const handleNavigate = (page) => {
    setCurrentPage(page);
  };

  return (
    <Router>
      <div>
        <Header />
        <Routes>
          <Route path="/" element={<MainContent onNavigate={handleNavigate} />} />
          <Route path="/Interface1" element={<Interface1 onNavigate={handleNavigate} />} />
          <Route path="/Interface2" element={<Interface2 onNavigate={handleNavigate} />} />
          <Route path="/Interface3" element={<Interface3 onNavigate={handleNavigate} />} />
          <Route path="/Interface4" element={<Interface4 onNavigate={handleNavigate} />} />
        </Routes>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
